import React from 'react';
import './App.css';

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/events", {
      method: 'POST',
      body: JSON.stringify({
        startDateTimeFrame : '2022-10-04T00:00:00Z',
        endDateTimeFrame : '2022-10-08T00:00:00Z'
      }),
      headers: {'Content-type': 'application/json; charset=UTF-8'},
    })
      .then((res) => res.json())
      .then((data) => {
        console.log("data ", data);
        setData(data.response[0].summary)
      });
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <p>{!data ? "Loading..." : data}</p>
      </header>
    </div>
  );
}

export default App;
